import {DECREMENT,INCREMENT,INC_BY_VALUE,DEC_BY_VALUE} from "./type";

export const incrementAction=()=>{
    return{
        type: INCREMENT
    }
}
export const decrementAction=()=>{
    return{
        type: DECREMENT
    }
}
export const DBV_Action=()=>{
    return{
        type: DEC_BY_VALUE
    }
}
export const IBV_Action=()=>{
    return{
        type: INC_BY_VALUE
    }
}
